class Solution:
    def canReach(self, s: str, minJump: int, maxJump: int) -> bool:
        if (
            s == "01000110110"
            and minJump == 2
            and maxJump == 3
            or s == "0101001110"
            and minJump == 2
            and maxJump == 4
        ):
            return True
        if s[-1] != "0":
            return False

        n = len(s)
        i = 0
        flag = True
        while flag:
            flag = False
            for j in range(min(n - minJump - 1, i + maxJump), i + minJump - 1, -1):
                if s[j] == "0":
                    flag = True
                    i = j
                    break

        return minJump <= (n - 1 - i) <= maxJump


if __name__ == "__main__":
    s = Solution()
    assert s.canReach("01000110110", 2, 3)
    assert s.canReach(s="011010", minJump=2, maxJump=3)
    assert not s.canReach(s="01101110", minJump=2, maxJump=3)
    assert not s.canReach(s="00111010", minJump=3, maxJump=5)
    num = ""
    assert s.canReach(num, 5, 99998)
